(128, 'KING ARTHUR: LEGEND OF SWORD', 'Petualangan Arthur (Charlie Hunnam) bersama teman-temannya membawa dia mengangkat pedang Excalibur yang melegenda.  Kemudian dengan pedang ‚Äúmagis‚Äù Excalibur itu, Arthur bergabung dengan seorang wanita misterius bernama Guinevere.   Ia terus mempelajari kekuatan pedang tersebut untuk bisa', 'Action, Adventure, Drama', 2017, '2017-03-07', 126, 'Guy Ritchie', 'Joby Harold, Guy Ritchie, Lionel Wigram', 'Charlie Hunnam, Jude Law, Djimon Hounsou, Eric Bana', 'http://www.21cineplex.com/data/gallery/pictures/149248561879841_300x430.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/6rbPTQIdjmY\" frameborder=\"0\" allowfullscreen></iframe>', 'tt1972591', 0, 0, 0, 0, 0, 0),
(129, 'ALIEN: COVENANT', 'Awak kapal koloni Perjanjian, terikat untuk sebuah planet terpencil di sisi jauh galaksi, menemukan apa yang mereka pikir adalah surga yang belum dipetakan, tapi ini benar-benar gelap, berbahaya di dunia. Ketika mereka menemukan sebuah ancaman di luar imajinasi mereka, mereka harus mencoba melarikan diri mengerikan', 'Sci-Fi, Thriller', 2017, '2017-05-19', 0, 'Ridley Scott', 'John Logan (screenplay), Dante Harper (screenplay), Jack Paglen (story by), Michael Green (story by), Dan O\'Bannon (based on characters created by), Ronald Shusett (', 'Katherine Waterston, Michael Fassbender, James Franco, Noomi Rapace', 'https://images-na.ssl-images-amazon.com/images/M/MV5BNzI5MzM3MzkxNF5BMl5BanBnXkFtZTgwOTkyMjI4MTI@._V1_SX300.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/H0VW6sg50Pk\" frameborder=\"0\" allowfullscreen></iframe>', 'tt2316204', 0, 0, 0, 0, 0, 0),
(130, 'AFTERMATH', 'Dua orang asing\' hidup menjadi terikat erat bersama-sama setelah bencana kecelakaan pesawat. Terinspirasi oleh peristiwa-peristiwa aktual, SETELAH bercerita tentang rasa bersalah dan balas dendam setelah pengendali lalu lintas udara (Scoot McNairy) kesalahan yang menyebabkan kematian seorang mandor bangunan (Arnold Schwarzenegger) istri dan putrinya.', 'Drama, Thriller', 2017, '2017-04-07', 92, 'Elliott Lester', 'Javier Gull√≥n', 'Arnold Schwarzenegger, Maggie Grace, Kevin Zegers, Scoot McNairy', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMWFkYmM2ZTctNmZjZi00MWQwLWI0MjctZDdiNjJlMTlmNzdkL2ltYWdlXkEyXkFqcGdeQXVyMjM4NTM5NDY@._V1_SX300.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/ZN8toxhSn9Y\" frameborder=\"0\" allowfullscreen></iframe>', 'tt4581576', 6, 43, 0, 5, 0, 2),
(131, 'STIP & PENSIL', 'Toni (Ernest Prakasa), Aghi (Ardit Erwandha), Bubu (Tatjana Saphira) dan Saras (Indah Permatasari) adalah anak anak orang kaya yang dimusuhi anak anak di SMU sekolahnya. Karena dibanding yang lain mereka selalu merasa sok jago dan songong.', 'Comedy, Family', 2016, '2016-10-07', 92, 'Steve Carr', 'Chris Bowman (screenplay), Hubbel Palmer (screenplay), Kara Holden (screenplay), James Patterson (based on the book by), Chris Tebbetts (based on the book by)', 'Griffin Gluck, Lauren Graham, Alexa Nisenson, Andrew Daly', 'http://www.21cineplex.com/data/gallery/pictures/148997964817267_300x430.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/spIsyTJ0DS8\" frameborder=\"0\" allowfullscreen></iframe>', 'tt4981636', 6.1, 51, 1, 1, 0, 2),
(132, 'BEFORE I FALL', 'Februari 12 ini hanya hari lain di Sam terpesona hidup sampai itu ternyata menjadi yang terakhir. Terjebak mengenang hari terakhir nya lebih dari satu bisa dijelaskan minggu, Sam mencegah misteri seputar kematiannya dan menemukan segala sesuatu yang dia dalam bahaya kehilangan.', 'Drama', 2017, '2017-03-03', 91, 'Ry Russo-Young', 'Maria Maggenti (screenplay), Lauren Oliver (based on the novel by)', 'Zoey Deutch, Halston Sage, Logan Miller, Kian Lawley', 'https://images-na.ssl-images-amazon.com/images/M/MV5BNDYwOTY0MDI2OV5BMl5BanBnXkFtZTgwOTE5NzM2MDI@._V1_SX300.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/q3Zyy4ZXegE\" frameborder=\"0\" allowfullscreen></iframe>', 'tt1691916', 6.5, 58, 0, 0, 0, 2),
(159, 'COLOSSAL', 'Seorang wanita menemukan bahwa berat peristiwa bencana yang entah bagaimana terhubung dengan gangguan mental dari mana dia menderita.', 'Action, Comedy, Sci-Fi', 2016, '2017-04-21', 110, 'Nacho Vigalondo', 'Nacho Vigalondo', 'Dan Stevens, Anne Hathaway, Jason Sudeikis, Tim Blake Nelson', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTY2NTExOTA2MF5BMl5BanBnXkFtZTgwNTMwMjE2MTI@._V1_SX300.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/fqcZtz8VXXE\" frameborder=\"0\" allowfullscreen></iframe>', 'tt4680182', 6.7, 59, 0, 0, 0, 0),
(160, 'UNLOCKED', 'CIA interogasi terpikat ke dalam tipu muslihat yang menempatkan London pada risiko serangan biologis.', 'Action, Thriller', 2016, '2016-11-02', 120, 'Michael Apted', 'Peter O\'Brien (screenplay)', 'Noomi Rapace, Toni Collette, Orlando Bloom, Michael Douglas', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMjk1NDcwMDkwN15BMl5BanBnXkFtZTgwOTU3NTI0MTI@._V1_SY1000_CR0,0,675,1000_AL_.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/CCqISHuTgHE\" frameborder=\"0\" allowfullscreen></iframe>', 'tt1734493', 0, 0, 0, 0, 0, 0),
(165, 'THE CIRCLE', 'Ketika Mae disewa untuk bekerja untuk dunia yang terbesar dan paling kuat teknologi dan perusahaan media sosial, dia melihat itu sebagai sebuah kesempatan seumur hidup. Saat ia naik melalui pangkat, dia didorong oleh pendiri perusahaan, Eamon Bailey, untuk terlibat dalam sebuah terobosan percobaan yang mendorong batas-batas privasi, etika dan akhirnya dia kebebasan pribadi. Partisipasinya dalam percobaan, dan setiap keputusan yang dia mulai mempengaruhi kehidupan dan masa depan dari teman-temannya, keluarga dan umat manusia.', 'Drama, Sci-Fi, Thriller', 2017, '2017-04-28', 110, 'James Ponsoldt', 'James Ponsoldt (screenplay), Dave Eggers (screenplay), Dave Eggers (based on the novel by)', 'Emma Watson, Karen Gillan, Tom Hanks, Bill Paxton', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMjY2OTM2Njc3Ml5BMl5BanBnXkFtZTgwNDgzODU3MTI@._V1_SX300.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/2C9tKfl8t0Y\" frameborder=\"0\" allowfullscreen></iframe>', 'tt4287320', 0, 0, 0, 0, 0, 0),
(166, 'STRATTON', 'Inggris Khusus Layanan Perahu komando melacak teroris internasional sel.', 'Action, Thriller', 2017, '2017-12-01', 120, 'Simon West', 'Duncan Falconer (based on the novel by), Warren Davis II (screenplay), Duncan Falconer (screenplay)', 'Connie Nielsen, Gemma Chan, Tyler Hoechlin, Tom Felton', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMjA3ODA2NDUyOV5BMl5BanBnXkFtZTgwNjc4MzkwOTE@._V1_SX300.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/bDBPPUWiJOg\" frameborder=\"0\" allowfullscreen></iframe>', 'tt3567666', 0, 0, 0, 0, 0, 0),
(167, 'MEMBABI BUTA', 'MARIATIN (Prisia Nasution) akhirnya diterima bekerja sebaga asisten rumah tangga dirumah milik dua orang perempuan kakak beradik SUNDARI dan SULASEMI yang berumur sekitar 55-60 tahun an. Mariatin juga membawa serta anaknya Asti untuk tinggal di rumah tersebut. Sundari', 'Action, Thriller', 2017, '2017-05-04', 120, 'Simon West', 'Duncan Falconer (based on the novel by), Warren Davis II (screenplay), Duncan Falconer (screenplay)', 'Connie Nielsen, Gemma Chan, Tyler Hoechlin, Tom Felton', 'http://www.21cineplex.com/data/gallery/pictures/149319172338172_300x430.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/XlAb5GX0M6Q\" frameborder=\"0\" allowfullscreen></iframe>', 'tt3567666', 0, 0, 0, 0, 0, 0),
(169, 'OVERDRIVE', 'Cerita berpusat pada dua pencuri mobil, saudara-saudara, yang melakukan perjalanan ke selatan Perancis untuk peluang baru dan angin di rambut lintas dari bos kejahatan lokal. Andrew dan Garrett Foster (...', 'Action, Thriller', 2017, '2017-05-05', 120, 'Antonio Negret', 'Michael Brandt, Derek Haas', 'Ana de Armas, Scott Eastwood, Gaia Weiss, Clemens Schick', 'https://images-na.ssl-images-amazon.com/images/M/MV5BOGU3MDkyM2MtYWNhMi00YjVhLWE1NmQtMDU5MmMyZjlmYmRlXkEyXkFqcGdeQXVyMTk1MDM0OTc@._V1_SY1000_CR0,0,737,1000_AL_.jpg', '<iframe width=\"854\" height=\"480\" src=\"https://www.youtube.com/embed/kWqAJE-Yshs\" frameborder=\"0\" allowfullscreen></iframe>', 'tt1935194', 0, 0, 0, 0, 0, 0),
(176, 'MIDDLE SCHOOL: THE WORST YEARS OF MY LIFE', 'Imajinatif tenang remaja Rafe Katchadorian lelah dari sekolah menengah obsesi dengan aturan di biaya apapun dan semua kreativitas. Putus asa untuk menggoyang, Rafe dan teman-temannya terbaik telah datang dengan rencana: mematahkan setiap aturan tunggal di sekolah dan membiarkan siswa berjalan liar.', 'Comedy, Family', 2016, '2016-10-07', 92, 'Steve Carr', 'Chris Bowman (screenplay), Hubbel Palmer (screenplay), Kara Holden (screenplay), James Patterson (based on the book by), Chris Tebbetts (based on the book by)', 'Griffin Gluck, Lauren Graham, Alexa Nisenson, Andrew Daly', 'https://images-na.ssl-images-amazon.com/images/M/MV5BNjQzMTczNjI0Ml5BMl5BanBnXkFtZTgwODY5MTY5OTE@._V1_SX300.jpg', NULL, 'tt4981636', 6.1, 51, 0, 0, 0, 3),
(179, 'THE DISAPPOINTMENTS ROOM', 'Arsitek Dana, suaminya David, dan anak mereka, Lucas pindah ke yang terisolasi manor di pedesaan yang mencari restart kehidupan mereka setelah kematian bayi putri mereka dalam sebuah kecelakaan tragis. Dana sengaja mendengar suara-suara di loteng dan menemukan tersembunyi kamar terkunci. Segera dia menemukan kunci dan dihantui oleh roh-roh jahat dari orang tua. Dia meneliti dan belajar yang lama pedesaan rumah-rumah kekecewaan ruang di mana keluarga dan anak cacat yang terkunci untuk menghindari rasa malu kepada keluarga tradisional. Selanjutnya, roh-roh asli pemilik rumah, Hakim Hitam, dan putrinya yang masih terjebak di dalam rumah. Namun, hanya Dana lebih mampu untuk melihat dan menghubungi mereka dan David percaya dia adalah delusi. Ketika Hakim Hitam mengancam kehidupan Lucas, Dana mencoba untuk melindungi dia tapi dia tidak yakin apa yang merupakan kenyataan atau melamun.', 'Drama, Horror, Thriller', 2016, '2016-09-09', 85, 'D.J. Caruso', 'D.J. Caruso, Wentworth Miller (screenplay)', 'Kate Beckinsale, Mel Raido, Duncan Joiner, Lucas Till', 'https://images-na.ssl-images-amazon.com/images/M/MV5BMTE0MTE3MzI4ODFeQTJeQWpwZ15BbWU4MDI1MDI0ODkx._V1_SX300.jpg', NULL, 'tt2364897', 3.9, 31, 0, 0, 0, 2),
(180, 'GUARDIANS OF THE GALAXY VOL. 2', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'http://www.21cineplex.com/data/gallery/pictures/149086206646137_300x430.jpg', NULL, NULL, NULL, NULL, 0, 0, 0, 1);
